import React, { Component } from 'react';
import Particles from 'react-particles-js';
import './App.css';

class App extends Component {
  render(){
    return (
      <div className='body'>
        <h1>Hello</h1>
        <Particles
    params={{
	    "particles": {
	        "number": {
	            "value": 50
	        },
	        "size": {
	            "value": 3
	        }
	    },
	    "interactivity": {
	        "events": {
	            "onhover": {
	                "enable": true,
	                "mode": "repulse"
	            }
	        }
	    }
	}} />

      </div>
    );
  }
}
export default App;
